import "./mine.css";
import Tips from "./components/tips/tip";
const tipsData = [
    {id: 1, image: require('./components/tips/tippic/onlineserve.png'), tip: 'Tip 1'},
    {id: 2, image: require('./components/tips/tippic/feedback.png'), tip: 'Tip 2'},
    {id: 3, image: require('./components/tips/tippic/prointro'), tip: 'Tip 3'},
    {id: 4, image: require('./image4.png'), tip: 'Tip 4'},
    {id: 5, image: require('./image5.png'), tip: 'Tip 5'},
    {id: 6, image: require('./image6.png'), tip: 'Tip 6'},
];

function mine(){
    return(
    <div className="mine-bg">
        <div id="self-info">
            <div id="avatar"></div>
            <div id="self-intro">张天弋<p id="stu-num">2022214959</p></div>
            <div id="more-info">详情</div>
            <div id="arrow"></div>
        </div>
        <div id="morefunc">
        {tipsData.map((tip) => (
            <Tips key={tip.id} image={tip.image} tip={tip.tip}/>
        ))}
        </div>
    </div>
    )
}
export default mine;
